function Navbar() {
    return ( 
        <aside id="sidebar" className="sidebar">
            <ul className="sidebar-nav" id="sidebar-nav">
                <li className="nav-item">
                    <a className="nav-link " href="">
                        <i className="bi bi-grid" />
                        <span>Home</span>
                    </a>
                </li>{/* End Home Nav */}
                
            </ul>
        </aside>
    );
}

export default Navbar;
